// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract AutoForwarder {
    address public owner;
    address public targetWallet;
    IERC20 public token;

    constructor(address _token, address _targetWallet) {
        owner = msg.sender;
        token = IERC20(_token);
        targetWallet = _targetWallet;
    }

    // Pull tokens from sender and forward instantly
    function pullAndForward(uint256 amount) external {
        require(token.transferFrom(msg.sender, address(this), amount), "transferFrom failed");
        require(token.transfer(targetWallet, amount), "forward failed");
    }

    // Change target wallet (only owner)
    function updateTargetWallet(address _targetWallet) external {
        require(msg.sender == owner, "Not owner");
        targetWallet = _targetWallet;
    }
}
